import React, { useEffect, useState } from 'react';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import AddIcon from '@mui/icons-material/Add';
import NavSearch from '../navSection/NavSearch';
import Container from 'react-bootstrap/Container';
import HighlightOffOutlinedIcon from '@mui/icons-material/HighlightOffOutlined';
import ListGroup from 'react-bootstrap/esm/ListGroup';
import CartCard from './CartCard';

const cartItems = [
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
];

function Cart() {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const checkScreenSize = () => {
      setIsScrolled(window.innerHeight  -30);
    };
    checkScreenSize();

    window.addEventListener('resize', checkScreenSize);

    return () => {
      window.removeEventListener('resize', checkScreenSize);
    };
  }, []);
  return (
    <div>
      <NavSearch />
      <Row className="m-3">
        <Card>
          <Card.Body>
            <h5 className="text-center d-none d-md-flex justify-content-center">
              You have (3) items in your cart
            </h5>
            <h5 className="text-center d-md-none">Cart (3)items </h5>
            <div className="d-flex flex-column gap-1">
              <div>
                <strong className="border-bottom border-grey">
                  Total: N37600.00
                </strong>
              </div>
              <div>
                {' '}
                <Button variant="light" className="text-success">
                  <AddIcon />
                  Add payment method
                </Button>{' '}
              </div>
              <div>
                <Button variant="light" className="text-success">
                  <AddIcon />
                  Add shipping
                </Button>{' '}
              </div>
            </div>
          </Card.Body>
        </Card>
      </Row>
      <Container>
        <Row>
          <Col
            md={8}
            style={{
              position: isScrolled ? 'static' : '',
              top: isScrolled ? 0 : '',
              height: isScrolled ? '100vh' : '',
              overflowY: isScrolled ? 'scroll' : '',
            }}
          >
            <div>
              <CartCard />
            </div>
          </Col>
          <Col md={4} className="my-">
            <Card className="border-0">
              <Card.Body>
                <div className="d-flex flex-column gap-1">
                  <div>
                    <strong className="border-bottom border-grey">
                      SubTotal(3 items): N37600.00
                    </strong>
                  </div>
                  <div>
                    {' '}
                    <Button variant="lighter" className=" fw-bold">
                      shipping Fee : N700.00
                    </Button>{' '}
                  </div>
                  <div>
                    <Button
                      variant="lighter"
                      className=" border-bottom border-grey  fw-bold"
                    >
                      Total Amount : N38300.00
                    </Button>{' '}
                    <div className="d-grid">
                      <Button
                        variant="success"
                        className=" border-bottom border-grey fs-5  fw-bold"
                      >
                        CheckOut(3)
                      </Button>{' '}
                    </div>
                  </div>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Cart;
